/** @jsxRuntime classic */
/** @jsx jsx */
import { jsx, Image } from 'theme-ui';
import { Link } from 'components/link';
import Logopath from 'assets/logo-path-alt.png'

export default function Logo({ src, ...rest }) {
  return (
    <Link
      path="/"
      sx={{
        variant: 'links.logo',
        display: 'flex',
        cursor: 'pointer',
        mr: 15,
      }}
      {...rest}
    >
      {/* <Image
        width="130"
        height="90"
        src={Logopath}
        alt="startup landing logo"
      /> */}
       <h1 sx={{
         ml: 4,
         fontWeight: 'bold',
         fontSize: ['28px', null, null, null, '40px', '38px', '58px'],
       }}>Path.</h1>
       <h1 sx={{
         color: '#6C368C',
         fontWeight: 'bold',
         fontSize: ['28px', null, null, null, '40px', '38px', '58px'],
         }}>ti</h1>
         {/* <Heading sx={styles.title}>
            Path.
            </Heading>
            <Heading sx={styles.title1}>
            ti
            </Heading> */}
    </Link>
  );
}

const styles = {
  title: {
    fontWeight: 'bold',
    fontSize: ['30px', null, null, null, '42px', '40px', '60px'],
    lineHeight: 1.33,
    letterSpacing: '-1px',
    color: 'textSecondary',
    pl: 4,    
  },
  title1: {
    fontWeight: 'bold',
    fontSize: ['30px', null, null, null, '42px', '40px', '60px'],
    lineHeight: 1.33,
    letterSpacing: '-1px',
    color: '#6C368C',
  }
}
